import React from 'react';
import Slider from 'react-slick';
import 'slick-carousel/slick/slick.css';
import 'slick-carousel/slick/slick-theme.css';

function SimpleSlider() {
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1
  };

  return (
    <div>
      <h2>Simple Slider</h2>
      <Slider {...settings}>
        <div>
          <img src="https://via.placeholder.com/800x400" alt="slide1" />
        </div>
        <div>
          <img src="https://via.placeholder.com/800x400" alt="slide2" />
        </div>
        <div>
          <img src="https://via.placeholder.com/800x400" alt="slide3" />
        </div>
      </Slider>
    </div>
  );
};

export default SSlider;
